import react from 'react'

let carrierObj={
border:"2px solid red",
height:"449px",
width:"500px"
}
const Emgcarrier=()=>{
    return(
        <>
        <div id="carrier" style={carrierObj}>
         
        </div>
        </>
    )
}
const Gameplay=()=>{
return(
    <>
<Emgcarrier/>
    </>
)
}
export default Gameplay
